static variables can also be used as resources. Tasks can only get & (shared) references to these resources but locks are never required to access their data. You can think of static resources as plain static variables that can be initialized at runtime and have better scoping rules: you can control which tasks can access the variable, instead of the variable being visible to all the functions in the scope it was declared in. In the example below a key is loaded (or created) at runtime and then used from two tasks that run at different priorities. //! examples/static.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] extern crate panic_semihosting; use cortex_m_semihosting::{debug, hprintln};
use lm3s6965::Interrupt; #[rtfm::app(device = lm3s6965)]
const APP: () = { static KEY: u32 = (); #[init] fn init(_: init::Context) -> init::LateResources { rtfm::pend(Interrupt::UART0); rtfm::pend(Interrupt::UART1); init::LateResources { KEY: 0xdeadbeef } } #[interrupt(resources = [KEY])] fn UART0(c: UART0::Context) { hprintln!("UART0(KEY = {:#x})", c.resources.KEY).unwrap(); debug::exit(debug::EXIT_SUCCESS); } #[interrupt(priority = 2, resources = [KEY])] fn UART1(c: UART1::Context) { hprintln!("UART1(KEY = {:#x})", c.resources.KEY).unwrap(); }
}; $ cargo run --example static
UART1(KEY = 0xdeadbeef)
UART0(KEY = 0xdeadbeef)

