Similarly, Sync is a marker trait for "types for which it is safe to share references between threads", according to its definition in core . In the context of RTFM the Sync trait is only required where it's possible for two, or more, tasks that run at different priority to hold a shared reference to a resource. This only occurs with shared static resources. The app attribute will enforce that Sync is implemented where required but it's important to know where the Sync bound is not required: in static resources shared between tasks that run at the same priority. The example below shows where a type that doesn't implement Sync can be used. //! `examples/not-sync.rs` #![deny(unsafe_code)]
#![deny(warnings)]
