Nesting calls to lock on the same resource must be rejected by the compiler for memory safety but nesting lock calls on different resources is a valid operation. In that case we want to make sure that nesting critical sections never results in lowering the dynamic priority, as that would be unsound, and we also want to optimize the number of writes to the BASEPRI register and compiler fences. To that end we'll track the dynamic priority of the task using a stack variable and use that to decide whether to write to BASEPRI or not. In practice, the stack variable will be optimized away by the compiler but it still provides extra information to the compiler. Consider this program: #[rtfm::app(device = ..)]
const APP: () = { static mut X: u64 = 0; static mut Y: u64 = 0; #[init] fn init() { rtfm::pend(Interrupt::UART0); } #[interrupt(binds = UART0, priority = 1, resources = [X, Y])] fn foo(c: foo::Context) { let mut x = c.resources.X; let mut y = c.resources.Y; y.lock(|y| { *y += 1; *x.lock(|x| { x += 1; }); *y += 1; }); // mid-point x.lock(|x| { *x += 1; y.lock(|y| { *y += 1; }); *x += 1; }) } #[interrupt(binds = UART1, priority = 2, resources = [X])] fn bar(c: foo::Context) { // .. } #[interrupt(binds = UART2, priority = 3, resources = [Y])] fn baz(c: foo::Context) { // .. } // ..
}; The code generated by the framework looks like this: // omitted: user code pub mod resources { pub struct X<'a> { priority: &'a Cell<u8>, } impl<'a> X<'a> { pub unsafe fn new(priority: &'a Cell<u8>) -> Self { X { priority } } pub unsafe fn priority(&self) -> &Cell<u8> { self.priority } } // repeat for `Y`
} pub mod foo { pub struct Context { pub resources: Resources, // .. } pub struct Resources<'a> { pub X: resources::X<'a>, pub Y: resources::Y<'a>, }
} const APP: () = { #[no_mangle] unsafe fn UART0() { // the static priority of this interrupt (as specified by the user) const PRIORITY: u8 = 1; // take a snashot of the BASEPRI let initial: u8; asm!("mrs $0, BASEPRI" : "=r"(initial) : : : "volatile"); let priority = Cell::new(PRIORITY); foo(foo::Context { resources: foo::Resources::new(&priority), // .. }); // roll back the BASEPRI to the snapshot value we took before asm!("msr BASEPRI, $0" : : "r"(initial) : : "volatile"); } // similarly for `UART1` impl<'a> rtfm::Mutex for resources::X<'a> { type T = u64; fn lock<R>(&mut self, f: impl FnOnce(&mut u64) -> R) -> R { unsafe { // the priority ceiling of this resource const CEILING: u8 = 2; let current = self.priority().get(); if current < CEILING { // raise dynamic priority self.priority().set(CEILING); let hw = logical2hw(CEILING); asm!("msr BASEPRI, $0" : : "r"(hw) : "memory" : "volatile"); let r = f(&mut X); // restore dynamic priority let hw = logical2hw(current); asm!("msr BASEPRI, $0" : : "r"(hw) : "memory" : "volatile"); self.priority().set(current); r } else { // dynamic priority is high enough f(&mut X) } } } } // repeat for `Y`
}; At the end the compiler will optimize the function foo into something like this: fn foo(c: foo::Context) { // NOTE: BASEPRI contains the value `0` (its reset value) at this point // raise dynamic priority to `3` unsafe { asm!("msr BASEPRI, 160" : : : "memory" : "volatile") } // the two operations on `Y` are merged into one Y += 2; // BASEPRI is not modified to access `X` because the dynamic priority is high enough X += 1; // lower (restore) the dynamic priority to `1` unsafe { asm!("msr BASEPRI, 224" : : : "memory" : "volatile") } // mid-point // raise dynamic priority to `2` unsafe { asm!("msr BASEPRI, 192" : : : "memory" : "volatile") } X += 1; // raise dynamic priority to `3` unsafe { asm!("msr BASEPRI, 160" : : : "memory" : "volatile") } Y += 1; // lower (restore) the dynamic priority to `2` unsafe { asm!("msr BASEPRI, 192" : : : "memory" : "volatile") } // NOTE: it would be sound to merge this operation on X with the previous one but // compiler fences are coarse grained and prevent such optimization X += 1; // lower (restore) the dynamic priority to `1` unsafe { asm!("msr BASEPRI, 224" : : : "memory" : "volatile") } // NOTE: BASEPRI contains the value `224` at this point // the UART0 handler will restore the value to `0` before returning
}

