This is the smallest possible RTFM application: //! examples/smallest.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] // panic-handler crate
extern crate panic_semihosting; use rtfm::app; #[app(device = lm3s6965)]
const APP: () = { #[init] fn init(_: init::Context) {}
}; All RTFM applications use the app attribute ( #[app(..)] ). This attribute must be applied to a const item that contains items. The app attribute has a mandatory device argument that takes a path as a value. This path must point to a peripheral access crate (PAC) generated using svd2rust v0.14.x . The app attribute will expand into a suitable entry point so it's not required to use the cortex_m_rt::entry attribute. ASIDE : Some of you may be wondering why we are using a const item as a module and not a proper mod item. The reason is that using attributes on modules requires a feature gate, which requires a nightly toolchain. To make RTFM work on stable we use the const item instead. When more parts of macros 1.2 are stabilized we'll move from a const item to a mod item and eventually to a crate level attribute ( #![app] ).

