Within the pseudo-module the app attribute expects to find an initialization function marked with the init attribute. This function must have signature fn(init::Context) [-> init::LateResources] . This initialization function will be the first part of the application to run. The init function will run with interrupts disabled and has exclusive access to Cortex-M and device specific peripherals through the core and device variables fields of init::Context . Not all Cortex-M peripherals are available in core because the RTFM runtime takes ownership of some of them -- for more details see the rtfm::Peripherals struct. static mut variables declared at the beginning of init will be transformed into &'static mut references that are safe to access. The example below shows the types of the core and device variables and showcases safe access to a static mut variable. //! examples/init.rs #![deny(unsafe_code)]
